package development

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_ACTUATOR_TEST_GROUP(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e ACTUATOR_TEST_GROUP
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := ACTUATOR_TEST_GROUP_ROLL_TORQUE.MarshalText()
		require.NoError(t, err)

		var dec ACTUATOR_TEST_GROUP
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, ACTUATOR_TEST_GROUP_ROLL_TORQUE, dec)
	})
}
